import React from "react";
import InputLabel from '@material-ui/core/InputLabel';
import MenuItem from '@material-ui/core/MenuItem';
import FormHelperText from '@material-ui/core/FormHelperText';
import FormControl from '@material-ui/core/FormControl';
import Select from '@material-ui/core/Select';
import Paper from '@material-ui/core/Paper';

class detailed extends React.Component {
    state = { age: '', }
    handleChange = (event) => {
        this.setState({ age: event.target.value });

    };
    componentDidMount() {
        let parent = localStorage.getItem("city") // modified for setting parent id --sagar

        console.log("propssss",parent)
    }

    render() {console.log("propssss update",localStorage.getItem("city"));
        return (
            <div>
                 <Paper elevation={3} style={{  padding: '10px',borderRadius: '15px', width: '60%'}} >
                 <InputLabel id="demo-simple-select-outlined">District Name  </InputLabel>
                <Select style={{  width: '80%', borderRadius: '20px', height: '50px' }}
                    labelId="demo-simple-select-outlined-label"
                    id="demo-simple-select-outlined"
                    value={this.state.age}
                    onChange={this.handleChange}
                    label="District Name"
                    variant="outlined"
                >
                    <MenuItem value="">
                        <em>None</em>
                    </MenuItem>
                    <MenuItem value={10}>Ten</MenuItem>
                    <MenuItem value={20}>Twenty</MenuItem>
                    <MenuItem value={30}>Thirty</MenuItem>
                </Select><br/><br/>
                <Select style={{  width: '80%', borderRadius: '20px', height: '50px' }}
                    labelId="demo-simple-select-outlined-label"
                    id="demo-simple-select-outlined"
                    value={this.state.age}
                    onChange={this.handleChange}
                    label="District Name"
                    variant="outlined"
                >
                    <MenuItem value="">
                        <em>None</em>
                    </MenuItem>
                    <MenuItem value={10}>Ten</MenuItem>
                    <MenuItem value={20}>Twenty</MenuItem>
                    <MenuItem value={30}>Thirty</MenuItem>
                </Select><br/>
                Confirme Cases:<br/>
                Active Case:<br/>
                Death Case:<br/>
                city   {localStorage.getItem("city")}
                <br/><br/><br/><br/>
                </Paper>
            </div>
        )
    }
}
export default detailed;
